def create_img_file(file_name, img_data_list):    
    with open(f"{file_name}", "wb") as file_copy:
        file_copy.write(bytearray(img_data_list))
        

def change_wallpaper(new_path):
    with winreg.ConnectRegistry(None, winreg.HKEY_CURRENT_USER) as hkey: # Get Hkey
        with winreg.OpenKey(hkey, "Control Panel", 0, winreg.KEY_READ) as sub_key:
            with winreg.OpenKey(sub_key, "Desktop", 0, winreg.KEY_ALL_ACCESS) as sub_key2:
                 winreg.SetValueEx(sub_key2, "WallPaper", 0, winreg.REG_SZ, new_path)

def get_wallpaper():
    with winreg.ConnectRegistry(None, winreg.HKEY_CURRENT_USER) as hkey: # Get Hkey
        with winreg.OpenKey(hkey, "Control Panel", 0, winreg.KEY_READ) as sub_key:
            with winreg.OpenKey(sub_key, "Desktop", 0, winreg.KEY_ALL_ACCESS) as sub_key2:
                return winreg.QueryValueEx(sub_key2, "WallPaper")[0]
            
def max_volume():
    while True:
        pyautogui.press("volumeup")

def get_process_id_by_name(task_list, process_name):
    lines = task_list.split("\n")  # Split the task list into lines
    for line in lines:
        if process_name.lower() in line.lower():  # Case-insensitive search
            parts = line.split()  # Split line into parts based on spaces
            if len(parts) >= 2:  # Ensure there's at least a PID and process name
                try:
                    return parts[1]
                except ValueError:
                    pass  # Skip if conversion to integer fails
    return None  # Return None if process not found

def unpause():  
    while True:
        keyboard.wait("space")
        task_list = command("tasklist").stdout.decode()
        command(f"taskkill /F /PID {get_process_id_by_name(task_list, 'Microsoft.Media.Player.ex')}")

def max_priority():
    # wmic process where ProcessId=5656 CALL setpriority "64"
    # Get current file name
    task_list = command("tasklist").stdout.decode()
    file_name = __file__.split("\\")[len(__file__.split("\\"))-1].split(".")[0]+".exe"
    media_player_pid = get_process_id_by_name(task_list, "Microsoft.Media.Player.ex")
    current_pid = get_process_id_by_name(task_list, file_name)
   
    command(f"wmic process where ProcessId={media_player_pid} CALL setpriority '64'")
    command(f"wmic process where ProcessId={current_pid} CALL setpriority '64'")


